/*global console */

(function ($) {

    'use strict';

    $.fn.overlayCarousel = function (options, callback) {

		var carouselContent = (options.carouselContent) ? options.carouselContent : [],
			parentContainer,
			currentIndexInView = 1,
			panelWidth,
			initialPanel,
			animationInProgress = false,
			carousel;

        return this.each(function () {
		    // Method wrapper
            var methods = (function () {
                // Initialise
                var init = function () {
					var html = "<ul class='overlay-carousel'>",
						iframe,
						lastPanel;

					initialPanel = options.initialPanel || 0,

					parentContainer = $("#overlay-carousel");

					if (initialPanel === 0) {
					// Only show three items at a time, last, first and second
						html += generateCarouselItem(carouselContent[carouselContent.length - 1]);
						html += generateCarouselItem(carouselContent[0]);
						html += generateCarouselItem(carouselContent[1]);
					}
					else {
						currentIndexInView = initialPanel + 1;

						// if loading the last image, append the first image
						lastPanel = (initialPanel + 1 === carouselContent.length) ? 0 : initialPanel + 1;

					// Only show three items at a time, last, first and second
						html += generateCarouselItem(carouselContent[initialPanel - 1]);
						html += generateCarouselItem(carouselContent[initialPanel]);
						html += generateCarouselItem(carouselContent[lastPanel]);
					}


					html += "</ul>";


					// Add to page and calculate width of container
					parentContainer.append(html);

					carousel = parentContainer.find("ul");
					carousel.css("width", getContainerWidth());

					carousel.css("left", "-100%");
					panelWidth = carousel.find(".carousel-wrapper").width();

					addNavigationDots();
					setupGestures();
					setupPanel();

					return this;
                };

                var generateCarouselItem = function (content) {
					var item;
					if (content.type === "image") {
						item = "<li><div class='carousel-wrapper'><div class='img-wrp'><img src="+content.image.replace(".jpg","-lrg.jpg")+"/></div>"+content.span+content.datetime+"</div>";
					}
					/*else if (content.type === "video") {
						item = "<li class='video'>"+datsun.createVideoMarkup(content.playerID, content.playerKey, content.videoPlayer, false);
					}*/

					return item+"</li>";
                };

                var getContainerWidth = function() {
					var width = (carouselContent.length * 100) + "%";

					//return width;
					return "300%";
                };

                // They dont actually work yet
                var addNavigationDots = function() {
					var html = "<div class='navigation'><ul><li class='next'></li><li class='prev'></li><li class='close'></li></ul><div class='bullet-pagination'><ul>",
						navigation,
						pagination,
						highlightNum = initialPanel;

					for (var c = 0; c < carouselContent.length; c++) {
						if (c === highlightNum) {
							html += "<li class='active'></li>";
						}
						else {
							html += "<li></li>";
						}
					}

					html += "</ul></div></div>";

					parentContainer.append(html);

					navigation = parentContainer.find(".navigation");
					pagination = navigation.find(".bullet-pagination");

					// add width to pagination to allow to center
					pagination.css("width", pagination.find("ul").width());

					navigation.on("click", "li", function(e) {
						e.preventDefault();
						var $this = $(this),
							pageNum;

						if ($this.is(".prev")) {
							scrollPrevious();
						}
						else if ($this.is(".next")) {
							scrollNext();
						}
						else {
							//
						}
					});

					alignArrowsVertically();

                };

                var alignArrowsVertically = function() {
					setTimeout(function() {
						$(".overlay").find(".next, .prev").css("top",(carousel.height() / 2)-71); // 71 half height of arrow
					},500);
                };

                var updatePagination = function() {
					var navigation = parentContainer.find(".navigation");
					navigation.find("li.active").removeClass("active");
					navigation.find("li:nth-child("+currentIndexInView+")").addClass("active");
                };

                // Add next panel
                var addNextItem = function() {
					var iframeIndexToLoad;

					if (currentIndexInView === (carouselContent.length)) {
						iframeIndexToLoad = 0;
					}
					else {
						iframeIndexToLoad = currentIndexInView;
					}

					var iframeSrc = carouselContent[iframeIndexToLoad];
					carousel.append(generateCarouselItem(iframeSrc));
                };

                // Add previous panel
                var addPrevItem = function() {
					var iframeIndexToLoad;

					if (currentIndexInView === 1) {
						iframeIndexToLoad = carouselContent.length-1;
					}
					else {
						iframeIndexToLoad = currentIndexInView - 2;
					}

					var iframeSrc = carouselContent[iframeIndexToLoad];
					carousel.prepend(generateCarouselItem(iframeSrc));
                };

                // remove item ready to add another one in
                var removeFirstItem = function() {
					carousel.find("li:first-child").remove();
                };

                var removeLastItem = function() {
					carousel.find("li:last-child").remove();
                };

                var scrollPrevious = function() {
					var here = this,
						callbackAfterAnimate = function() {
						addPrevItem();
						removeLastItem();
						setupPanel();
						updatePagination();
						animationInProgress = false;
					};

					if(animationInProgress){
						return false;
					}else{
						animationInProgress = true;
					}

					currentIndexInView--;
					if (currentIndexInView <= 0) {
						currentIndexInView = carouselContent.length;
					}

					if(Modernizr.cssanimations){
						carousel.css("left", "0");
						setTimeout(function(){
							carousel.addClass("disable");
							carousel.css("left", "-100%");
							callbackAfterAnimate();
							setTimeout(function() {
									carousel.removeClass("disable");
								},100);
						},500);
					}else{
						carousel.animate({
							left: "0"
						}, function() {
							carousel.css("left", "-100%");
							callbackAfterAnimate();
						});
					}

                };

                var scrollCurrent = function() {
					carousel.css("left", "-100%");
                };

                var scrollNext = function() {
					var here = this,
						callbackAfterAnimate = function() {
							addNextItem();
							removeFirstItem();
							setupPanel();
							updatePagination();
							animationInProgress = false;
						};

					if(animationInProgress){
						return false;
					}else{
						animationInProgress = true;
					}

					currentIndexInView++;

					if (currentIndexInView > carouselContent.length) {
						currentIndexInView = 1;
					}

					if(Modernizr.cssanimations){
						carousel.css("left", "-200%");
						setTimeout(function(){
							carousel.addClass("disable");
							carousel.css("left", "-100%");
							callbackAfterAnimate();
							setTimeout(function() {
									carousel.removeClass("disable");
								},100);
						},500);
					}else{
						carousel.animate({
							left: "-200%"
						}, function() {
							carousel.css("left", "-100%");
							callbackAfterAnimate();
						});
					}

                };

                // If this is a video panel, then load brightcove
                var setupPanel = function() {
					var panelInView = carousel.find("li:nth-child(2)");
					if (panelInView.length > 0) {
						panelInView.find("object").addClass("BrightcoveExperience");
						brightcove.createExperiences();
					}
                };

				var setupGestures = function() {
					        var startPos,
								startHeightPos,
					            endPos,
					            lastPos,
					            existingContainerLeftPosition,
					            totalDistanceSwiped = 0,
					            totalPercentageSwiped,
					            here = this,
					            thresholdForSnap = 10; // the min percentage a user has to swipe before scrolling to next panel

					        function handleTouchEvents(e) {
					            var direction = 0,
					                totalHeightSwiped;

					            if (e.type === "touchstart") {
					                existingContainerLeftPosition = parseInt(carousel[0].style.left.replace("px","").replace("%",""),10);
					                startPos = lastPos = event.touches[0].clientX;
					                startHeightPos = event.touches[0].clientY;
					                totalDistanceSwiped = 0; // reset if no touch move
					                carousel.addClass("disable");


					            } else if (e.type === "touchmove" ) {
					                totalDistanceSwiped = event.touches[0].clientX - startPos;
					                totalHeightSwiped = event.touches[0].clientY - startHeightPos;
					                totalPercentageSwiped = (totalDistanceSwiped / panelWidth)*100;

					                //datsun.log(event.touches[0].clientX);
					                if (totalDistanceSwiped < -10 || totalDistanceSwiped > 10) {
					                    e.preventDefault();
										carousel.css("left", (existingContainerLeftPosition + totalPercentageSwiped)+"%");
										return true;
					                }
					                else {
										return true;
					                }
					            } else if (e.type === "touchend") {
									carousel.removeClass("disable");
									if (!totalPercentageSwiped) {
										// if user just taps and not moves
										return false;
									}

					                else if (totalPercentageSwiped > thresholdForSnap) {
				                        // Snap back to existing panel
				                        scrollPrevious();
					                }
					                else if (totalPercentageSwiped < -thresholdForSnap) {
										scrollNext();
					                }
					                else {
				                        // Snap back to existing panel
				                        scrollCurrent();
					                }
					            }
					        }

					        carousel.bind('touchstart', handleTouchEvents);
					        carousel.bind('touchmove', handleTouchEvents);
					        carousel.bind('touchend', handleTouchEvents);
					    };

                init();

            })();

        });

    };

})(jQuery);

