define("carousel-overlay", ["jquery", "overlay"], function($, overlay) {
	"use strict";

	$("[data-module~='carousel-overlay']").each(function () {
		var carousel = $(this),
			loadImg,
			initialPanel,
			img,
			overlayCarousel,
			imageInViewHeight,
			topPosForNav,
			firstTime = true,
			alignArrows = function() {
				// Height is definately known by now
				imageInViewHeight = overlayCarousel.find("li:nth-child(2)").first().find("img").height();
				topPosForNav = (imageInViewHeight - 70) / 2;

				// Align arrows
				overlayCarousel.find(".prev").css("top", topPosForNav);
				overlayCarousel.find(".next").css("top", topPosForNav);
			},
			verticallyAlignAll = function() {
				overlay.verticallyCenter(alignArrows);
				overlayCarousel.unbind();
			};

		$(this).find(".panel").on("click", "a", function() {

			// dont show overlay on small devices
			if (!datsun.isSmallViewport() && $(this).attr('target') !== '_blank') {

				overlay.html("<div id='overlay-carousel'></div>");

				// Need to find out which index this is being clicked.
				overlay.show();

				// Center lightbox once first image is loaded
				initialPanel = $(this).parent().data("index");

				// jquery plugin
				carousel.overlayCarousel({
					carouselContent: carousel.data().panels.panels,
					initialPanel: initialPanel
				});

				overlayCarousel = $("#overlay-carousel");

				imageInViewHeight = overlayCarousel.find("li:nth-child(2)").first().find("img").height();


				if (imageInViewHeight > 0) {
					verticallyAlignAll();
				}
				else {
					overlayCarousel.resize(function() {
						imageInViewHeight = overlayCarousel.find("li:nth-child(2)").first().find("img").height();
						// Is the image height > 0?
						if (imageInViewHeight !== 0) {
							verticallyAlignAll();
						}
					});
				}
			}


		});
    });

});

