// define a main function with a jquery dependency
define("carousel-timeline", ["jquery"], function($) {
    "use strict";
    $('[data-module~="carousel-timeline"]').each(function() {
        var $this = $(this),
            targetCarousel = datsun.carousels[$(this).data('carousel-id')],
            marker = $('.selected-marker', this),
            initial = true,
            maxItems = $(".timeline-pagination").find("li").not('.start, .end').length;

        targetCarousel.addStartAnimationCallback(function(panel) {
            var goingToPanel = $(panel).next().attr('id'),
                listItem = $('a[href=#' + goingToPanel + ']', $this).parent().not('.start, .end'),
                listIndex = listItem.index(),
                moveTo;

            // console.log(listItem, (listItem.index() * 70));
            // $('> ul', $this).css('margin-left', ( -1 * ( (listItem.index()) * 70-20) + 70) + 'px');
            if(listIndex < 1){
                listIndex = maxItems;
            }

            $('> ul', $this).css('margin-left', ( -1 * ( listIndex * 70) + 100) + 'px');
            marker.css('left', (5 + 5 * (listIndex)) + '%');
        });

        $(this).on('click', 'a', function() {
            //find target element
            var target;

            // console.log($('' + $(this).attr('href'), $('article', targetCarousel.container).not('.temp')));
            target = $('[id=' + $(this).attr('href').substring(1) + ']:not(.temp)', targetCarousel.container);
            //console.log(targetCarousel);
            targetCarousel.gotoElement(target);
            return false;
        });
    });
});

	/*jslint plusplus: true, browser: true, regexp: true */
	/*global define, datsun, alert, Modernizr*/
	// carousel plugin
