// define a main function with a jquery dependency
define("countdown", ["jquery"], function($) {
    "use strict";
    var nowSystem = new Date();
    $('[data-module~="countdown"]').each(function() {
        var countdown = this;
        function startCountdown() {
            var nowServer, previousValues = {};
             //get number of seconds in timer on page load
            nowServer = $(countdown).data('seconds');

            function setUnit(unitClass, newVal) {
                var unitsEl, unitsNew;

                if (previousValues[unitClass] === undefined) {
                    //value not previously set, set and return
                    previousValues[unitClass] = newVal;
                    return;
                }
                if (previousValues[unitClass] === newVal) {
                    //no change to this unit, return
                    return;
                }
                previousValues[unitClass] = newVal;

                $(unitClass + ' .units', countdown).not(':last').remove();
                unitsEl = $(unitClass + ' .units', countdown);

                if (newVal < 10) {
                    newVal = "0" + newVal;

                }
                unitsNew = $("<span></span>").addClass('units in').text(newVal);
                unitsEl.after(unitsNew);
                unitsEl.removeClass('in').addClass('out');
            }

            function setTime() {
                var seconds, minutes, hours, days, newTime = Math.floor(nowServer - Math.abs((nowSystem - new Date()) / 1000));
                // $('p', $(countdown).parent()).text(new Date()); // to test, Android emulator clock ticks slowly...(!)
                days =  Math.floor(newTime / 86400);
                newTime = newTime - days * 86400;
                hours = Math.floor(newTime / 3600);
                newTime = newTime - hours * 3600;
                minutes = Math.floor(newTime / 60);
                newTime = newTime - minutes * 60;
                seconds = newTime;
                setUnit(".seconds", seconds);
                setUnit(".minutes", minutes);
                setUnit(".hours", hours);
                setUnit(".days", days);

                //run again after the next system clock second tick
                setTimeout(setTime, 1001 - (new Date()).getMilliseconds());
            }
            setTime();
        }
        startCountdown();
    });
});

