// define a main function with a jquery dependency
define("mobile-menu", ["jquery"], function($) {
    "use strict";
    var dropdowns = $('[data-module~="mobile-menu"]'),
        $nav = $('.header-menu'),
        navHeight = $nav.height();

    dropdowns.find('> strong').on('click', function(){
        var $link = $(this),
            $parent = $link.parent(),
            $menu = $link.next('ul');



        if(!$parent.is('.active')){
            //Check if sibling is open and do proper transition
            if($parent.siblings('.active').length > 0){
                reset('close', $nav.height());

                setTimeout(function(){
                    $nav.removeClass('disable-transitions');
                    $parent.siblings('.active').removeClass('active');
                    $parent.addClass('active');
                    $nav.css('height', $menu[0].scrollHeight + navHeight);
                    reset('open');
                },10);
            }else{
                $parent.addClass('active');
                $nav.css('height', $menu[0].scrollHeight + navHeight);
                reset('open');
            }

        }else{
            reset('close', $nav[0].scrollHeight);
            $parent.removeClass('active');

            setTimeout(function(){
                $nav.removeClass('disable-transitions');
                setTimeout(function(){
                    $nav.css('height', navHeight);
                },0);
            },0);
        }
    });


    function reset(to, height){
        if(to === 'open'){
            setTimeout(function(){
                $nav.addClass('disable-transitions');
                $nav.height("auto");
                setTimeout(function(){
                    $nav.removeClass('disable-transitions');
                },0);
            },300);
        }else{
            $nav.addClass('disable-transitions');
            $nav.css('height', height);
        }
    }
});

