// define a main function with a jquery dependency
define("overlay", ["jquery"], function($) {
    "use strict";
    // Setup html for overlay
    var overlay = '<div class="w-overlay"><div class="container"><div class="overlay"></div></div></div>',
		woverlay,
		hide;

    $("body").append(overlay);

    woverlay = $(".w-overlay");
    overlay = woverlay.find(".overlay");

	hide = function() {

			// explicity remove the flash embed to prevent IE8 moaning
			if (datsun.browsers.msie8) {
				woverlay.find(".BrightcoveExperience").parent().html("");
			}

			woverlay.css("display","none").find(".overlay").removeClass("video").html("");
		};

	// Close if X or any whitespace is clicked
    woverlay.on("click", function(e) {
		if (datsun.browsers.msie8) {
			if ($(e.target).is(".close")) {
				hide();
			}
		}
		else if ($(e.target).is(".w-overlay") || $(e.target).is(".close") || $(e.target).is(".container")) {
			hide();
		}
    });

    return {
		// change contents of overlay
		html: function(html) {
			overlay.html(html);
		},
		show: function(type) {
			var top;

			if (type === "video") {
				overlay.addClass("video");
			}

			var windowHeight = $(window).height(),
				overlayHeight = overlay.outerHeight(); // include padding

			top = (windowHeight - overlayHeight)/2;

			// show and vertically align
			overlay.attr("style","").css("margin-top", 0).parent().parent().css("display", "block");

		},
		verticallyCenter: function(callback) {
			var center = function() {
				var windowHeight = $(window).height(),
					overlayHeight, // include padding
					overlayInnerHeight,
					top,
					imgWrapWidth,
					imgWrapHeight;


				// set height of image wrapper
				imgWrapHeight = overlay.find(".img-wrp").width() * 0.56;
				overlay.find(".img-wrp").css("height", imgWrapHeight);

				overlayHeight = overlay.outerHeight(), // include padding
				overlayInnerHeight = overlay.height(),

				top = (windowHeight - overlayHeight)/2;

				if (top < 0) {
					top = 0;
				}

				// show and vertically align
				overlay.attr("style","").css("margin-top", top).parent().parent().css("display", "block");
				if (datsun.browsers.msie8) {
					overlay.css("height",overlayInnerHeight);
				}
				if (typeof callback === "function") {
					callback();
				}
			};

			center();
		}
	};
});

