define("register-validate", ["jquery"], function ($) {
    "use strict";
    var $form = $('[data-module~="register-validate"]'),
        $registerBox = $('.register-interest'),
        submitted = false;

    $form.on('submit', function (e) {
        trimFields();
        if (!submitted && isFormValid($(this))) {
            submitted = true;
            return true;
        } else {
            return false;
        }
    });

    $('input').on('change', function () {
        $(this).closest('.error').removeClass('error');
    });

    $('input').on('blur', function () {
        trimFields();
    });

    if( document.location.href.indexOf('?reg=complete') > -1 ){
        submitSuccess();
    }

    function submitSuccess() {
        $('.register-area-form').hide();
        $('.register-area-complete').show();
        $('.main-menu, #register-tab').click(); //display register interest dropdown
    }

    function trimFields() {
        var email = $('#email');
        var name = $("#last_name");
        email.val($.trim(email.val()));
        name.val($.trim(name.val()));
    }

    function submitError() {
        $('.form-error').show();
        $form.removeClass('fade');
    }

    function isFormValid($formElem) {
        var $boxName = $('.register-name'),
            $boxEmail = $('.register-email'),
            name = $formElem.find('#last_name'),
            email = $formElem.find('#email'),
            hasErrors = false;

        if (!name.val()) {
            $boxName.addClass('error');
            hasErrors = true;
        }

        if (!email.val() || !isValidEmail(email.val())) {
            $boxEmail.addClass('error');
            hasErrors = true;
        }

        if (hasErrors) {
            return false;
        } else {
            return true;
        }
    }

    function isValidEmail(text) {
        return text.split('@').length === 2;
    }

});

