// define a main function with a jquery dependency
define("track-as-page", ["jquery"], function($) {
    "use strict";
    var sections = $('[data-module~="track-as-page"]'), visible = {}, timeoutScrollEvent, locale = datsun.getLocaleFromURL();

    //thanks to http://upshots.org/javascript/jquery-test-if-element-is-in-viewport-visible-on-screen
    $.fn.isOnScreen = function(){
        var win = $(window);
        var viewport = {
            top : win.scrollTop(),
            left : win.scrollLeft()
        };
        viewport.right = viewport.left + win.width();
        viewport.bottom = viewport.top + win.height();
        var bounds = this.offset();
        bounds.right = bounds.left + this.outerWidth();
        bounds.bottom = bounds.top + this.outerHeight();
        return (!(viewport.right < bounds.left || viewport.left > bounds.right || viewport.bottom < bounds.top || viewport.top > bounds.bottom));
    };

    function callTrack(pageid) {
        //call google analytics
        //console.log(pageid, ga);
        ga('send', 'pageview', {
        	'page': 'datsun/' + pageid,
			'Market': locale
        });
    }

    function checkElementInViewport(el) {
        return $(el).isOnScreen();
    }

    function initVisible() {
        //loop over each element, track as a page view if it's visible
        var elementVisible, pageid;
        sections.each(function() {
            elementVisible = checkElementInViewport(this);
            pageid = $(this).data("pageid");
            if (elementVisible) {
                callTrack(pageid);
            };
            visible[pageid] = elementVisible;
        });
    }

    function updateVisible() {
        //loop over each element, track as page view if it has come into view since last check
        var elementVisible, pageid;
        sections.each(function() {
            elementVisible = checkElementInViewport(this);
            pageid = $(this).data("pageid");
            if(!visible[pageid] && elementVisible) {
                callTrack(pageid);
            }
            visible[pageid] = elementVisible;
        });

    }

    function scrollFinishEvent() {
        updateVisible();
    };

    function scrollEvent() {
        timeoutScrollEvent && clearTimeout(timeoutScrollEvent);
        timeoutScrollEvent = setTimeout(scrollFinishEvent, 500);
    };

    initVisible();
    $(window).on('scroll', scrollEvent);
});

