// define a main function with a jquery dependency
define("track-page-load", ["jquery"], function($) {
    "use strict";

    var pathName = window.location.pathname,
		locale = datsun.getLocaleFromURL();

    //Just replace if custom path is required
    switch(pathName){
        case "/": pathName = "/home"; break;
        case "/models": pathName = "/models/datsun-go"; break;
    }

    pathName = "datsun" + pathName;

    ga('send', 'pageview', {
    	'page': pathName,
		'Market': locale
    });
});

