// use to load brightcove
define("video-overlay", ["jquery", "overlay", "brightcove"], function($, overlay) {
	"use strict";

	var $active;

    // Loop through all anchors with video overlay data and assign click to open overlay
    $("a[data-video], div[data-video]").each(function() {

    	var anchor,
			config,
			markup,
			wrapper,

			BCplayer,
			BCmodVideoPlayer,
			BCmodExperience;

	    /*if (Modernizr.touch) {
			// Show video preview in carousel
			anchor = $(this);
			config = anchor.data("video");
			markup = datsun.createVideoMarkup(config.playerID, config.playerKey, config.videoPlayer);
			anchor.prepend(markup).find("img").remove();
			brightcove.createExperiences();
	    }*/


		$(this).on("click", function(e) {
			e.preventDefault();
			anchor = $(this);

			config = anchor.data("video");
			markup = datsun.createVideoMarkup(config.playerID, config.playerKey, config.videoPlayer);

			if (datsun.isSmallViewport()) {

				// var createLink = function(videoURL) {
				// 	window.location = videoURL;
				// };
				//console.log(anchor.data("video-url"))
				// datsun.getBrightcoveVideoFile(config.videoPlayer, createLink);
				window.location = anchor.data("video-url");


			    /*// Video is loaded in page
			    if (anchor.find("> img").length > 0) {
			        anchor.find("> img").replaceWith(markup);
			    } else {
			        anchor.closest("section").html(markup);
			    }

				brightcove.createExperiences();*/
			}
			else {
				var close = "<div class='navigation'><ul><li class='close'></li></ul></div>";
			    // Show meta data in lightbox
				if (anchor.data("show-meta") !== false) {
				    overlay.html(markup + anchor.find("span")[0].outerHTML + anchor.find("time")[0].outerHTML + close);
				} else {
				    overlay.html(markup + close);
				}
				// Needed twice to center lightbox before and after video has init
				overlay.show("video");
				brightcove.createExperiences();
				//overlay.show("video");
				overlay.verticallyCenter();
			}

			$active = $(this);
		});

		datsun.brightcoveTemplateLoaded = function (experienceId) {
			BCplayer = brightcove.getExperience(experienceId);
			BCmodVideoPlayer = BCplayer.getModule(APIModules.VIDEO_PLAYER);
			BCmodExperience = BCplayer.getModule(APIModules.EXPERIENCE);

			BCmodExperience.addEventListener(BCExperienceEvent.TEMPLATE_READY, datsun.brightcoveTemplateReady);
		}

		datsun.brightcoveTemplateReady = function (event) {
			BCmodVideoPlayer.addEventListener(BCMediaEvent.COMPLETE, datsun.trackEvent);
			BCmodVideoPlayer.addEventListener(BCMediaEvent.BEGIN, datsun.trackEvent);
		}

		datsun.trackEvent = function (event) {
			$active.trigger("trackEvent", event.type);
		}

    });
});

