// fixes and replication for vw unit in non compliant browsers
define("vw", ["jquery"], function($) {
    "use strict";

    function setVWFontSize($element) {
        var resizer, z;
        /*we only need to run this if the browser doesn't support vw text sizes (e.g. android), or if the browser implementation is buggy (webkit)*/
        if (datsun.browsers.msie8) {
            //do nothing, ie8 and below are forced to full width site with ie.css
            return;
        } else if (!Modernizr.cssvwunit) {/*if vw unit is not supported*/
            //TODO: test
            //adapted from FitText.js https://github.com/davatron5000/FitText.js
            // Store the object
            resizer = function () {
                var windowWidth = $(window).width(),
                    width = Math.max(Math.min(windowWidth, 1600), 320),
                    fontSize = width / 100;
                $element.css('font-size', fontSize);
            };
            // Call once to set.
            resizer();

            // Call on resize. Opera debounces their resize by default.
            $(window).on('resize orientationchange', resizer);

        } else if (Modernizr.webkit) {
            /* vw implementation in webkit is buggy, so kick it*/
            /* when this is fixed in a webkit release build, can also add a version check here*/
            /* may need to add check for chrome when they move away from webkit, if this isn't fixed */
            /* https://bugs.webkit.org/show_bug.cgi?id=87846 */
            z = 1;
            $(window).resize(function () {
                $element.css('z-index',  z++);
            });
        }
    }

    $('[data-module~="vw"]').each(function() {
        var $root = $(this), selector = $root.data('vw-selector');
        //first check if we're applying to 'this' or a selector, by looking for presence of 'data-vw-selector' attribute
        if (selector) {
            $(selector, $root).each(function() {setVWFontSize($(this)); });
        } else {
            setVWFontSize($root);
        }
    });
});

var datsun = {};

datsun.init = function() {
	"use strict";
	datsun.ie6();
	datsun.viewports();
	// $("window").load(function() {
	//   $("body").addClass("loaded");//needed for some css animations
	// });
};

datsun.validateEmail = function(email) {
	"use strict";
	var re = /^(([^<>()[\]\\.,;:\s@\"]+(\.[^<>()[\]\\.,;:\s@\"]+)*)|(\".+\"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
    return re.test(email);
};

datsun.log = function(log) {
	"use strict";
	if (window.console) {
		console.log(log);
	}
};

datsun.animate = function(parent, animProps, callback, args) {
	"use strict";

	var transEndEventNames,
		transEndEventName,
		callbackFn = (typeof callback === 'function') ? true : false;

	if (Modernizr.cssanimations) {
		transEndEventNames = {
				'WebkitTransition' : 'webkitTransitionEnd',
				'MozTransition'    : 'transitionend',
				'OTransition'      : 'oTransitionEnd',
				'msTransition'     : 'MSTransitionEnd',
				'transition'       : 'transitionend'
		};

		transEndEventName = transEndEventNames[ Modernizr.prefixed('transition') ];

		if (callbackFn) {
			$(parent).on(transEndEventName, function() {
				callback(args);
				$(parent).unbind(transEndEventName);
			});
		}

		$(parent).css(animProps);

	}
	else {
		//$(parent).addClass("disable-anim");
		$(parent).animate(animProps,{
			queue: false,
			complete: (callbackFn) ? function() { callback(args); } : function() {}
		});
	}
};

datsun.browsers = function() {
	"use strict";
	var browsers = {},
		html = $("html"),
		ua = navigator.userAgent.toLowerCase();
	browsers.msie6 = browsers.msie8 = browsers.msie9 = browsers.ipad = browsers.iphone = browsers.android = browsers.android23 =false;

	if (html.is(".ie-6")) {
		browsers.msie6 = true;
	}
	else if (html.is(".ie-8")) {
		browsers.msie8 = true;
	}
	else if (html.is(".ie-9")) {
		browsers.msie9 = true;
	}

	browsers.ipad = Modernizr.ipad;
	browsers.iphone = Modernizr.iphone;
	browsers.android = Modernizr.android;
	return browsers;
}();

datsun.ie6 = function() {
	"use strict";
	// Adding CSS in JS as CSS doesnt load well in IE6
	if (datsun.browsers.msie6) {
		$("body").prepend("<div id='ie6-unsupported' style='font-size: 17px;background: #005496; color: white; text-align: center;	padding: 15px;'>" +
							"We do not support the browser Internet Explorer 6. If you are using Internet Explorer 6, please upgrade to a more up-to-date version of the browser." +
							"</div>");
	}
};

datsun.isSmallViewport = function() {
	"use strict";
	return Modernizr.mq("screen and (max-width:767px)");
};

datsun.isMediumViewport = function() {
	"use strict";
	return Modernizr.mq("screen and (min-width:768px) and (max-width: 999px)");
};

datsun.isLargeViewport = function() {
	"use strict";
	if (this.browsers.msie8 || this.browsers.msie7  || this.browsers.msie6) {
		return true;
	} else {
		return Modernizr.mq("screen and (min-width: 1000px)");
	}
};

/**
 * Returns current viewport
 *	small viewport = 1
 *	medium viewport = 2
 *	large viewport = 3
 */
datsun.getCurrentViewport = function () {
    "use strict";

    if (this.isSmallViewport()) {
        return 1;
    } else if (this.isMediumViewport()) {
        return 2;
    } else if (this.isLargeViewport()) {
        return 3;
    }
};

datsun.viewports = function() {
	"use strict";
		var newViewport,
			here = this,
			lastViewport = datsun.getCurrentViewport(),
			// Common fn to fire triggers on resize and orientation change
			fireViewportTriggers = function() {
				var newViewport = datsun.getCurrentViewport();
				switch(newViewport) {
					case 1:
						$.publish("smallViewportActive");
						datsun.log("small viewport active");
						break;
					case 2:
						$.publish("mediumViewportActive");
						$.publish("mediumOrLargeViewportActive");
						datsun.log("medium viewport active");
						break;
					case 3:
						$.publish("largeViewportActive");
						$.publish("mediumOrLargeViewportActive");
						datsun.log("large active");
						break;
				}
				$.publish("viewportChanged");
			};

			// Fire triggers on window resize only if viewport changes
			$(window).on('resizestop', function (e) {
				$.publish("windowResize");
				newViewport = here.getCurrentViewport();
				if (newViewport === lastViewport) {
					// Same viewport, do nothing
					return false;
				}
				else {
					fireViewportTriggers();

					lastViewport = newViewport;
				}
			});
};

/**
 * Returns the class of the main section tag
 */
datsun.getSiteSection = function () {
	"use strict";
	var sectionClass = $("#main > .container > section").attr("class");

	if (sectionClass.indexOf(" ") > -1) {
		return sectionClass.substr(0, sectionClass.indexOf(" "));
	} else {
		return sectionClass;
	}
};

/**
 * Returns the last part of the URL to get locale
 */
datsun.getLocaleFromURL = function () {
	"use strict";
	var locale = location.host.replace(/^.*\./, "");

	if(locale === "com"){
		return "gl";
	}else{
		return locale;
	}
};

/**
 * Create markup for brightcove player
 * @param  {[boolean]} addBrightCoveClass if false, then the class isnt added, allows to init one video at a time
 */
datsun.createVideoMarkup = function(playerID, playerKey, videoPlayer, addBrightCoveClass) {
	"use strict";

	// Only auto start on non touch devices
	var secureParams = '',
		autoStart = function() {
			var html = "";

			if (!Modernizr.touch) {
				html = '<param name="autoStart" value="true"/>';
			}
			return html;
		},
		brightcoveClass = function() {
			var className = "";
			if (addBrightCoveClass !== false) {
				className = "BrightcoveExperience";
			}
			return className;
		};

	if(window.location.protocol === 'https:'){
		secureParams = '<param name="secureConnections" value="true" />' +
				'<param name="secureHTMLConnections" value="true" />';
	}


	return '<div style="display:none"></div>' +
			'<object id="datsunExperience'+playerID+'" class="'+brightcoveClass()+'">' +
				'<param name="bgcolor" value="#FFFFFF" />' +
				'<param name="width" value="480" />' +
				'<param name="height" value="270" />' +
				'<param name="playerID" value="'+playerID+'" />' +
				'<param name="playerKey" value="'+playerKey+'" />' +
				autoStart() +
				'<param name="isVid" value="true" />' +
				'<param name="isUI" value="true" />' +
				'<param name="wmode" value="transparent" />' +
				'<param name="dynamicStreaming" value="true" />' +
				'<param name="includeAPI" value="true" />' +
				'<param name="&#64;videoPlayer" value="' + videoPlayer + '" />' +
				'<param name="templateLoadHandler" value="datsun.brightcoveTemplateLoaded" />' +
				secureParams +
			'</object>';
};

datsun.getBrightcoveVideoFile = function(videoPlayerID, callback) {
	"use strict";
	var url = "/api/MediaUrlService/" + videoPlayerID,
		req = $.ajax(url)
			.done(function(response) {
				if (response.FLVURL) {
					callback(response.FLVURL);
				}
			}).fail(function() {
				callback();
			});
};

